INSERT INTO `config_info` VALUES (2, 'brave-auth-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    database: 0\n    port: 6379\n    password: 123456\n    host: 127.0.0.1\n# Spring Boot Admin 开启和暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always', '5d80ad402950f2c1624af1bc8da5522b', '2021-06-23 05:57:37', '2021-08-12 08:31:08', 'nacos', '172.18.0.1', '', 'ecfd1e10-0d45-4fb0-b4a8-74b77c4f7e65', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (4, 'brave-mbs-rest-dev.yml', 'DEFAULT_GROUP', 'spring:\n  redis:\n    database: 0\n    port: 6379\n    password: 123456\n    host: 127.0.0.1\n# Spring Boot Admin 开启和暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\nmybatis-plus:\n  config-location:\n    - classpath*:/mapper/**/*Mapper.xml', '5e343eae38405bf712750328bbd3ff3c', '2021-06-23 06:05:22', '2021-08-12 08:31:18', 'nacos', '172.18.0.1', '', 'ecfd1e10-0d45-4fb0-b4a8-74b77c4f7e65', '', '', '', 'yaml', '');
INSERT INTO `config_info` VALUES (6, 'brave-gateway-dev.yml', 'DEFAULT_GROUP', 'spring:\n  security:\n    oauth2:\n      resourceserver:\n        jwt:\n          jwk-set-uri: \'http://localhost:8081/rsa/getPublicKey\'\n  redis:\n    database: 0\n    port: 6379\n    password: 123456\n    host: 127.0.0.1\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n          lower-case-service-id: true\n      routes:\n        - id: brave-auth\n          uri: lb://brave-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            - StripPrefix=1\n        - id: brave-mbs-rest\n          uri: lb://brave-mbs-rest\n          predicates:\n            - Path=/mbs/**\n          filters:\n            - StripPrefix=1\nsecure:\n  ignores:\n    - /auth/oauth/token\n    - /auth/oauth/captch\n    - /mbs/sysMenu/getRouters\n    - /mbs/sysUser/info\n    - /mbs/sysRole/list\n# Spring Boot Admin 开启和暴露所有端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always', '72c191b431dc59dab5aa977d1671eea7', '2021-06-23 06:06:43', '2021-08-12 09:16:56', 'nacos', '172.18.0.1', '', 'ecfd1e10-0d45-4fb0-b4a8-74b77c4f7e65', '', '', '', 'yaml', '');
